import React, { useState } from 'react'
import "./ImageApi.css"
import axios from 'axios'
function ImageApi() {
  const [images, setImages] = useState([])
  const getImages = async () => {
    try {
      const res = await axios.get('https://picsum.photos/seed/picsum/200/300')
      const Data = res.data
      setImages([Data])
      console.log(DA)

    } catch (error) {
      console.error("Error in fetching Image")
    }



  }
  return (
    <div>
      <h1>Welcome</h1>
      <button className='btn' onClick={getImages}>Get Images</button>

      
        <div className='ApiImages'>
          {
            images.map((elem, id)=>{
            return  <h1 key={id}>{elem.author}</h1>
            })
          }
          
    </div>
    </div>


  )
}

export default ImageApi
